script: |
  super -f text -I q9086.spq | sort > q9086.out

inputs:
  - name: q9086.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( + ( + col1 ) * + + col2 * + - col1 ) BETWEEN + col2 AND ( - - col0 * - col2 );
  - name: tab1

outputs:
  - name: q9086.out
    data: |
      51	14	96
      85	5	59
      91	47	68
